import React from 'react';
import PropTypes from 'prop-types';
import './style.css';

const SortInput = ({
    title
  }) => {
    return (
        <div className="SortInput">
          <hr />
          <h1>{title ? title : 'Select Algorithm'}</h1>
          </div>
    );
  };

  SortInfo.propTypes = {
    title: PropTypes.string
  };
  export default SortInput;
